    "noaa-office-for-coastal-management-coastal-inundation-digital-elevation-model-channel-islands-c",nt"isopen":
    false,nt"url": null,nt"notes": "These data were created as part of the
    National Oceanic and Atmospheric Administration Office for Coastal Management's
    efforts to create an online mapping viewer called the Sea Level Rise and Coastal
    Flooding Impacts Viewer. It depicts potential sea level rise and its associated
    impacts on the nation's coastal areas. The purpose of the mapping viewer is to provide
    coastal managers and scientists with a preliminary look at sea level rise (slr)
    and coastal flooding impacts. The viewer is a screening-level tool that uses nationally
    consistent data sets and analyses. Data and maps provided can be used at several
    scales to help gauge trends and prioritize actions for different scenarios. The
    Sea Level Rise and Coastal Flooding Impacts Viewer may be accessed at: http://www.coast.noaa.gov/slr
    This metadata record describes the Channel Islands, CA digital elevation model (DEM),
    which is a part of a series of DEMs produced for the National Oceanic and Atmospheric
    Administration Office for Coastal Management's Sea Level Rise and Coastal Flooding
    Impacts Viewer described above. This DEM includes the best available lidar known
    to exist at the time of DEM creation that met project specifications for the Channel
    Islands, CA. This includes the islands of Anacapa, Santa Barbara, San Miguel, Santa
    Rosa, and Santa Cruz. The DEM was produced from LiDAR acquired by the U.S. Geological
    Survey (USGS) in 2010 for the Channel Islands. See Supplemental Information for
    additional information about this data set. Hydrographic breaklines were derived
    from LiDAR intensity imagery using intensity raster stereo models. The final DEM
    is hydro flattened such that water elevations are less than or equal to -1 meters.
    The DEM is referenced vertically to the North American Vertical Datum of 1988 (NAVD88)
    with vertical units of meters and horizontally to the North American Datum of 1983
    (NAD83). The resolution of the DEM is approximately 5 meters.",nt"license_title":
